Evc='DecoratorPanel',Kxc='DefaultCalendarView',Lxc='DefaultCalendarView$CellGrid',Mxc='DefaultCalendarView$CellGrid$DateCell',sAc='DefaultComboBoxModel',Rsc='DefaultDateTimeFormatInfo',Nxc='DefaultMonthSelector',Oxc='DefaultMonthSelector$1',Pxc='DefaultMonthSelector$2',Uxc='DefaultSelectionEventManager',Vxc='DefaultSelectionEventManager$SelectAction',Xxc='DefaultSelectionEventManager$SelectAction;',Ezc='DefaultUnitConverter',Fzc='DelayedRunnable',Gzc='DelayedRunnable$1',Ldc='Deutsch',Rvc='DialogBox',Xvc='DialogBox$1',Vvc='DialogBox$CaptionImpl',Wvc='DialogBox$MouseHandler',wpc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Izc='Dimension',Clc='Dimension [height=',Yvc='DirectionalTextHelper',_vc='DockLayoutPanel',awc='DockLayoutPanel$Direction',bwc='DockLayoutPanel$Direction;',ewc='DockLayoutPanel$DockAnimateCommand',cwc='DockLayoutPanel$LayoutData',dsc='DomEvent',isc='DomEvent$Type',qyc='Double',iic='EAST',qcc='EEE, d MMM yyyy HH:mm:ss Z',toc='EEE. dd MMM. yyyy HH:mm:ss',Kcc='EEEE, MMMM d',tcc='EEEE, MMMM d, y',X9b='EM',Mfc='EMPTY',Rfc='ENABLED',Xdc='END',Z9b='EX',Cuc='ElementMapperImpl',Duc='ElementMapperImpl$FreeNode',Mdc='English',qrc='Enum',Ddc='Etc/GMT',Fdc='Etc/GMT+',Edc='Etc/GMT-',mac='Event type',wxc='Event$NativePreviewEvent',vsc='EventBus',Hqc='EventObject',Mqc='Exception',Pgc='Expecting version 6 from server, got ',hbc='F',Emc='F8834F07517EF3B7D02B9E845E5E1B88',S9b='FIXED',lhc='FLOAT',mmc='Fail: ',Bbc='Feb',pbc='February',ryc='Float',fwc='FlowPanel',Gvc='FocusWidget',Ekc='For input string: "',dcc='Fri',Ybc='Friday',Aac='GET',Koc='GGD55XLBAH',nqc='GGD55XLBAK',Gpc='GGD55XLBBI',Ync='GGD55XLBBJ',Joc='GGD55XLBCH',Ipc='GGD55XLBCI',lqc='GGD55XLBCK',nfc='GGD55XLBDB',Ioc='GGD55XLBDH',ooc='GGD55XLBDJ',Pec='GGD55XLBEB',Goc='GGD55XLBEH',Hpc='GGD55XLBEI',ofc='GGD55XLBFB',Noc='GGD55XLBFH',Wp
